INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (401, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24001, 0.0, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 102301, 24, "アヤネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (402, 1, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24002, 2.21, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 102301, 24, "アヤネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (403, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24003, 0.0, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 102301, 24, "アヤネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (701, 2, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24004, 1.99, 0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192201, 24, "アサヒ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (702, 1, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24005, 2.21, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192201, 24, "アサヒ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (703, 2, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24006, 3.33, 0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192201, 24, "アサヒ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (801, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24007, 0.0, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192301, 24, "部員３");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (802, 1, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24008, 2.68, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192301, 24, "部員３");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (803, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24009, 0.0, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192301, 24, "部員３");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (501, 1, "やった！", 24010, 0.0, 0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192501, 24, "");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (502, 1, "勝ったよ！", 24011, 0.0, 0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192501, 24, "");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (503, 1, "いい調子！", 24012, 0.0, 0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192501, 24, "");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (111, 6, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24013, 5.33, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113501, 24, "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (112, 1, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24014, 6.85, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113501, 24, "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (113, 1, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24015, 3.0, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113501, 24, "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (611, 1, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24016, 6.11, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192401, 24, "ダイチ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (612, 1, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24017, 6.75, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192401, 24, "ダイチ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (613, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24018, 0.0, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192401, 24, "ダイチ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (211, 2, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24019, 4.52, 0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113401, 24, "ハツネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (212, 2, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24020, 3.89, 0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113401, 24, "ハツネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (213, 1, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24021, 13.49, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113401, 24, "ハツネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (311, 1, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24022, 3.17, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 106501, 24, "カヤ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (312, 1, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24023, 4.42, 0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 106501, 24, "カヤ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (313, 6, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24024, 2.89, 0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 106501, 24, "カヤ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (421, 4, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24025, 3.71, 0.0, 10046, 0.0, 3, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 102301, 24, "アヤネ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (721, 2, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24026, 5.1, 0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192201, 24, "アサヒ");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (821, 1, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24027, 4.34, 0.0, 10046, 0.0, 3, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192301, 24, "部員３");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (521, 1, "いい勝負だったよ\nまたやろうね", 24028, 0.0, 0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 192501, 24, "");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (101, 1, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24029, 5.62, 0.0, 10046, -360.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113501, 24, "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (102, 1, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24030, 9.58, 0.0, 10046, -360.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113501, 24, "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (103, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24031, 0.0, 0.0, 10046, -360.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113501, 24, "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (104, 2, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24032, 9.13, 0.0, 10046, -360.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113501, 24, "ミサト");
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (105, 1, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24033, 8.27, 0.0, 10046, -360.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 113501, 24, "ミサト");
